import React from 'react'

import './help.css'

const Help = ({active, setActive}) => {
  return (
    <div className={active ? "help active" : "help"}>
        <img src="https://img.icons8.com/ios-glyphs/30/000000/delete-sign.png" onClick={() => setActive(false)}/>
        <div className="help__content" onClick={e => e.stopPropagation()}>

        </div>
    </div>
  )
}

export default Help
